103rd Division (2nd Formation) (People's:
The 103rd Division(Chinese: 第103师)(2nd Formation) was activated on February 26, 1951 from 5th Military Sub-district and elements from the former 103rd Division. The division was composed of: 307th Infantry Regiment (former 5th Security Regiment of Zhejiang Military District);
308th Infantry Regiment (expanded from 2nd Battalion, 309th Infantry Regiment of former 103rd Division);
309th Infantry Regiment (1st and 3rd Battalion, Security Regiment of Zhejiang Military Region). The division was acting as Wenzhou Military Sub-district.

206th Division (1st Formation) (People's:
The 206th Division (Chinese: 第206师) was created in January 1949 under the Regulation of the Redesignations of All Organizations and Units of the Army, issued by Central Military Commission on November 1, 1948, basing on the 20th Brigade, 7th Column of Huabei Military Region, formed in November 1947. The division was a part of 69th Corps. Under the flag of 206th it took part in battles during the Chinese Civil War. The division was then composed of: 616th Infantry Regiment;
617th Infantry Regiment;
618th Infantry Regiment.

206th Division (2nd Formation) (People's:
206th Army Division(Chinese: 陆军第206师) was formed in December 1969 from 6th Engineer District of Beijing Military Region. The division was a part of 69th Army Corps. From 1969 to 1985 the division was composed of: 616th Infantry Regiment;
617th Infantry Regiment;
618th Infantry Regiment;
Artillery Regiment. The division was disbanded in September 1985.

189th Division (2nd Formation) (People's:
In October 1969 186th Army Division(Chinese: 陆军第186师) was formed from 2nd Engineer District, Engineer Corps of Beijing Military Region. The division was a part of 63rd Army Corps. In December 1969 the division was renamed as 189th Army Division(Chinese: 陆军第189师), and all its regiments were re-designated as: 565th Infantry Regiment;
566th Infantry Regiment;
567th Infantry Regiment;
Artillery Regiment. In July 1985 the division was disbanded.

143rd Division (3rd Formation) (People's:
The 143rd Army Division (Chinese: 陆军第143师)(3rd Formation) was formed in November 1969. As of December 1969 the division was composed of: 427th Infantry Regiment;
428th Infantry Regiment;
429th Infantry Regiment;
Artillery Regiment. The division belonged to Guangzhou Military Region, while under the command of 42nd Army Corps. It stationed in Taishan, Guangdong for agricultural production mission. In November 1978 the division was disbanded.

97th Division (2nd Formation) (People's:
97th Division(Chinese: 第97师)(2nd Formation) was formed in October 1950 from 1st Security Brigade of Huadong Military Region. The division was directly belonged to East China Military Region. The division was inactivated in May 1952 and reorganized as 2nd Agricultural Construction Division. As of inactivation the division was composed of: 289th Regiment;
290th Regiment;
291st Regiment.
